<script>
import TweenMax from'greensock';
import DotLoader from 'vue-spinner/src/DotLoader';
import { setTimeout } from 'timers';
import Modal from './Modal.vue'

export default {
  name: 'app',
  components: { 
    Modal,
    DotLoader 
  },
  data() {
    return {
      // rotationを動的に変化させる
      rotationX: 0.0,
      rotationY: 0.0,

      modal: false,
      isLoading: true,
      motionContinue: true,
      color: `#000000`,
      size: `200px`
    }
  },
  computed: {
    // これをhtmlに埋め込むとカーソル追跡
    rotation() {
      return {
        // transformは奥行き、rotateでx,y方向にカーソル追跡
        transform: `perspective(800px) rotateY(${this.rotationX}deg) rotateX(${this.rotationY}deg)`
      }
    }
  },
  methods: {
    // カーソルの位置を受け取って
    onMouseMoved(e) {
      // 最大の回転の角度
      const maxRotation = 20.0;
      // pageX,Yでカーソルの座標eから取得
      // document.body.client~でクライアントの画面サイズを取得
      const x = (e.pageX / document.body.clientWidth) * 2 - 1;
      const y = (e.pageY / document.body.clientHeight) * 2 - 1;
      this.rotationX = maxRotation * x;
      this.rotationY = -maxRotation * y;
    },

    // モーダル部分
    openModal() {
      this.modal = true
    },
    closeModal() {
      this.modal = false
    },
    loaded() {
      setTimeout(() => {
        this.isLoading = !this.isLoading;
        TweenMax.to('.blind', 1, {opacity: 0});
      }, 2000)
      setTimeout(() => {
        this.motionContinue = !this.motionContinue;
      }, 3000)
    }
  },
}
</script>

